      {%- endif %}
    {%- endfor -%}
  {%- endif -%}

  {%- if alter_comments | length > 0 -%}
    {% do run_query(one_alter_relation(relation, alter_comments|join(', '))) %}
  {%- endif -%}
{% endmacro %}

