    {#- AppProfileMatching -#}


    {#- для заданного линка берём его сущности  и ключи-#}
    {%- set link_entities = links[link_name]['main_entities'] -%} {# связанные линком хабы #}
    {%- set link_keys = links[link_name].get('keys') -%} {# доп. ключи для линка #}
